import React from "react";

const SignUpPage = () => {
  return (
    <div>
      <form action="">
        <input
          type="text"
          onChange={handleChange}
          name="name"
          placeholder="Name..."
          value={name}
        />
        <input
          type="password"
          onChange={handleChange}
          name="password"
          placeholder="Password..."
          value={password}
        />
        <button>SignUp</button>
      </form>
    </div>
  );
};

export default SignUpPage;
